import { Amount, Button, ChargeScreenForm } from './ChargeScreen.styled';

export default function ChargeScreen() {
  const handleClick = (evt) => {
    evt.preventDefault();
  };
  return (
    <ChargeScreenForm flex>
      <Amount type="text" flex justify="center" align="center"></Amount>
      <Button
        flex
        justify="center"
        align="center"
        onClick={handleClick}
        placeholder="금액을 입력하세요"
      >
        클릭
      </Button>
    </ChargeScreenForm>
  );
}
